<script setup>
import { ref, watch, onMounted } from 'vue';
import { onClickOutside } from '@vueuse/core';

const emit = defineEmits(['active', 'inactive']);
const activeRegion = ref(null);

const changeActiveRegion = (region) => {
  activeRegion.value = region;
};
watch(activeRegion, (newValue) => {
  if (newValue) {
    emit('active');
  } else {
    emit('inactive');
  }
});

onMounted(() => {
  const regions = document.getElementsByClassName('region');
  for (const region of regions) {
    onClickOutside(region, () => (activeRegion.value = null));
  }
});
</script>
