  height: 100%;
}
.region {
  fill: transparent;
  cursor: pointer;
  transition: all 0.5s ease 0s;
  will-change: fill;
  stroke: #fff;
}
.region.active,
.region.active:hover {
  fill: #21e7d6;
  stroke: none;
}
